public class DeliveryStreamFactory(string resourceName = null, Action<Humidifier.KinesisFirehose.DeliveryStream> factoryAction = null) : ResourceFactory<Humidifier.KinesisFirehose.DeliveryStream>(resourceName)
{

    internal InnerDeliveryStreamDeliveryStreamEncryptionConfigurationInputFactory DeliveryStreamEncryptionConfigurationInputFactory { get; set; }

    internal InnerDeliveryStreamHttpEndpointDestinationConfigurationFactory HttpEndpointDestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamKinesisStreamSourceConfigurationFactory KinesisStreamSourceConfigurationFactory { get; set; }

    internal InnerDeliveryStreamIcebergDestinationConfigurationFactory IcebergDestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamRedshiftDestinationConfigurationFactory RedshiftDestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamAmazonopensearchserviceDestinationConfigurationFactory AmazonopensearchserviceDestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamMSKSourceConfigurationFactory MSKSourceConfigurationFactory { get; set; }

    internal InnerDeliveryStreamSplunkDestinationConfigurationFactory SplunkDestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamExtendedS3DestinationConfigurationFactory ExtendedS3DestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamAmazonOpenSearchServerlessDestinationConfigurationFactory AmazonOpenSearchServerlessDestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamElasticsearchDestinationConfigurationFactory ElasticsearchDestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamSnowflakeDestinationConfigurationFactory SnowflakeDestinationConfigurationFactory { get; set; }

    internal InnerDeliveryStreamS3DestinationConfigurationFactory S3DestinationConfigurationFactory { get; set; }

    protected override Humidifier.KinesisFirehose.DeliveryStream Create()
    {
        var deliveryStreamResult = CreateDeliveryStream();
        factoryAction?.Invoke(deliveryStreamResult);

        return deliveryStreamResult;
    }

    private Humidifier.KinesisFirehose.DeliveryStream CreateDeliveryStream()
    {
        var deliveryStreamResult = new Humidifier.KinesisFirehose.DeliveryStream
        {
            GivenName = InputResourceName,
        };

        return deliveryStreamResult;
    }
    public override void CreateChildren(Humidifier.KinesisFirehose.DeliveryStream result)
    {
        base.CreateChildren(result);

        result.DeliveryStreamEncryptionConfigurationInput ??= DeliveryStreamEncryptionConfigurationInputFactory?.Build();
        result.HttpEndpointDestinationConfiguration ??= HttpEndpointDestinationConfigurationFactory?.Build();
        result.KinesisStreamSourceConfiguration ??= KinesisStreamSourceConfigurationFactory?.Build();
        result.IcebergDestinationConfiguration ??= IcebergDestinationConfigurationFactory?.Build();
        result.RedshiftDestinationConfiguration ??= RedshiftDestinationConfigurationFactory?.Build();
        result.AmazonopensearchserviceDestinationConfiguration ??= AmazonopensearchserviceDestinationConfigurationFactory?.Build();
        result.MSKSourceConfiguration ??= MSKSourceConfigurationFactory?.Build();
        result.SplunkDestinationConfiguration ??= SplunkDestinationConfigurationFactory?.Build();
        result.ExtendedS3DestinationConfiguration ??= ExtendedS3DestinationConfigurationFactory?.Build();
        result.AmazonOpenSearchServerlessDestinationConfiguration ??= AmazonOpenSearchServerlessDestinationConfigurationFactory?.Build();
        result.ElasticsearchDestinationConfiguration ??= ElasticsearchDestinationConfigurationFactory?.Build();
        result.SnowflakeDestinationConfiguration ??= SnowflakeDestinationConfigurationFactory?.Build();
        result.S3DestinationConfiguration ??= S3DestinationConfigurationFactory?.Build();
    }

} // End Of Class

